/* Procedure structure for procedure `getDomainByName` */

/*!50003 DROP PROCEDURE IF EXISTS  `getDomainByName` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `getDomainByName`(in domain_name1 varchar(250),in conditions varchar(250))
BEGIN
		declare table_name1 VARCHAR(255);
		select table_name into table_name1 from sys_domain WHERE domain_name = domain_name1;
    SET @sqlStmt = CONCAT('SELECT * from ',table_name1,' where del_flag="0" ',if(conditions is null or conditions='','',conditions));
    PREPARE stmt FROM @sqlStmt;
    EXECUTE stmt;
END */$$
DELIMITER ;

